import React from 'react';
import { FirstN, LastN } from './App'
const C = () => {
    return (
        <>
        <FirstN.Consumer >{(obj) => {
            return (<LastN.Consumer>{(ob) => {
                return (<h1>Hi my name is{obj} {ob} </h1>)
            }}</LastN.Consumer>)
        }}</FirstN.Consumer>
        </>
    )
}
export default C;
